import React from 'react';
import logo from './logo.svg';
import './App.scss';
import Sidebar from './components/sidebar/Sidebar';
import ISidebar from './interfaces/ISidebar';

function App() {
  const sidebarDetails: ISidebar = {
    title: 'Hi'
  }
  return (
    <div className="App">
      <Sidebar sidebar={sidebarDetails}/>
    </div>
  );
}

export default App;
